import React, {useState} from 'react'
import Login from './Login';
import WorkoutSetup from './WorkoutSetup';
import Ready from './Ready';

export default function Home() {
    
    const user = {id: "" ,fName: "" ,gender: ""}
    const [page, setPage] = useState("login")

    const changePage = (pageName) => {setPage(pageName)}
  
    const switchPage = () => {
      switch(page) {
        case "login":
          return <Login changePage={changePage} />
        case "workouts":
          return <WorkoutSetup changePage={changePage} />
          case "ready":
            return <Ready changePage={changePage}/>
        
      }
    } 
  
    return (
    <div>
        {switchPage()}
    </div>
  )
}
